import React, { useState } from 'react';
//import data from './data/products.json';
import './App.css';
import './ProductMenu.css';

const ProductMenu = ({ match }) => {
    return(
        <div className="container">
            <div className="product-categories border border-rouned">
                <p>Eindom</p>
                <div class="input-group mb-3">
                    <input type="text" className="form-control" placeholder="Søk i eindom..."></input>
                    <button class="btn btn-outline-secondary" type="button"><i class="fas fa-search"></i></button>
                </div>
                <div class="slidecontainer d-flex">
                    <input type="text" style={{}}></input>
                    <input type="range" min="1" max="100" value="50" class="slider" id="myRange"/>
                </div>
                <p>Stad</p>
                <p>Pris</p>
                <p>Gis bort eller til salgs</p>
                <p>Gammel eller ny</p>
                <p>Nye i dag</p>
                <p>Brand</p>
                <p>Farge</p>
                <p>Storrelse</p>
                <p>Best selger</p>
            </div>
        </div>
    )
}

export default ProductMenu;
